import React from 'react';
import './App.css';
import Login from './login/Login';
import Map from './map/Map';
import Profile from './profile/Profile';
import Signup from './signup/Signup';
import Header from './shared/Header';

// const PAGES = {
//     login: () => <Login />,
//     map: () => <Map />,
//     profile: () => <Profile />,
//     signup: () => <Signup />
// };

const PAGES = [
    {
        id: 'login',
        name: 'Логин',
        component: () => <Login />
    },
    {
        id: 'map',
        name: 'Карта',
        component: () => <Map />
    },
    {
        id: 'profile',
        name: 'Профиль',
        component: () => <Profile />
    },
    {
        id: 'signup',
        name: 'Регистрация',
        component: () => <Signup />
    }
];

class App extends React.Component {
    constructor() {
        super();
        this.state = {activePage: 'login'};
    }

    render() {
        return (
            <div className="App">
                <Header pages={PAGES} />
                {/*{PAGES[this.state.page]()}*/}
            </div>
        );
    }
}

export default App;
